import React from 'react'
import Particles from 'react-particles-js';

const options = {
  background: {
    color: {
      width:'100%',
      height:'100%',
      value: "#0d47a1",
    },
  },
  fpsLimit: 60,
    interactivity: {
    detectsOn: "canvas",
      events: {
      onClick: {
        enable: true,
          mode: "push",
      },
      onHover: {
        enable: true,
          mode: "repulse",
      },
      resize: true,
    },
    modes: {
      bubble: {
        distance: 400,
          duration: 2,
          opacity: 0.8,
          size: 40,
      },
      push: {
        quantity: 4,
      },
      repulse: {
        distance: 200,
          duration: 0.4,
      },
    },
  },
  particles: {
    color: {
      value: "#ffffff",
    },
    links: {
      color: "#ffffff",
        distance: 150,
        enable: true,
        opacity: 0.5,
        width: 1,
    },
    collisions: {
      enable: true,
    },
    move: {
      direction: "none",
        enable: true,
        outMode: "bounce",
        random: false,
        speed: 6,
        straight: false,
    },
    number: {
      density: {
        enable: true,
          value_area: 800,
      },
      value: 80,
    },
    opacity: {
      value: 0.5,
    },
    shape: {
      type: "circle",
    },
    size: {
      random: true,
        value: 5,
    },
  },
  detectRetina: true,
}

const Home = () => {
  return (
    <div >
      <div className="particles">
        <Particles params={options}/>
      </div>
      <div className="home">
        <h1 className="display-2 ">Welcome to the GG_clone app</h1>
      </div>
    </div>
  )
}

export default Home
